import React from 'react';

import About from './About';
import Services from './Services';
import Profile from './Profile';

import './css/App.css';

class App extends React.Component {
  render () {
    return (
      <div className="App">
        <div className='Container'>
          <Profile />
          <About />
        </div>
      </div>
    );
  }
}

export default App;
